// Get custom field mappings
const fields = $input.all()[0].json;
const mapping = {};

if (Array.isArray(fields)) {
  for (const field of fields) {
    const name = field.name.toLowerCase();
    if (name.includes('role') || name.includes('title')) {
      mapping.roleTitle = field.key;
    } else if (name.includes('department')) {
      mapping.department = field.key;
    } else if (name.includes('hire')) {
      mapping.hireDate = field.key;
    } else if (name.includes('start')) {
      mapping.startDate = field.key;
    }
  }
}

return [{ json: { fieldMapping: mapping } }];

const course = $input.all()[0].json;
const fieldMapping = $('Map Custom Fields').item.json.fieldMapping;

let surveyId = '2363';
if (course.units) {
  const surveyUnit = course.units.find(u => u.type === 'Survey' || u.type === 'survey');
  if (surveyUnit) surveyId = surveyUnit.id;
}

// Exclude test/admin accounts
const excludedUserIds = ['1'];

const completedUsers = [];
if (course.users) {
  for (const user of course.users) {
    if (excludedUserIds.includes(String(user.id))) continue;
    const isCompleted = user.completion_percentage === '100' || user.completion_percentage === 100;
    if (!isCompleted) continue;
    completedUsers.push({
      userId: user.id,
      userName: user.name,
      surveyId: surveyId,
      fieldMapping: fieldMapping,
      completedOn: user.completed_on || ''
    });
  }
}

if (completedUsers.length === 0) {
  return [{ json: { hasNewUsers: false, message: 'No completed users found' } }];
}

// Dedup handled by Google Sheets appendOrUpdate with Email matching
return completedUsers.map(u => ({ json: { ...u, hasNewUsers: true } }));

// Transform data for Google Sheet
const surveyAnswers = $('Get Survey Answers').item.json;
const userDetails = $input.item.json;

// Skip users hired before Jan 1, 2026
const hireDateStr = userDetails.custom_field_31 || '';
if (hireDateStr) {
  const parts = hireDateStr.split('/');
  if (parts.length === 3) {
    const hireDate = new Date(parts[2], parts[0] - 1, parts[1]);
    if (hireDate < new Date(2026, 0, 1)) {
      return []; // Filter out this item
    }
  }
}

const context = $('Has New Users?').item.json;
const fieldMapping = context.fieldMapping || {};
const completedOn = context.completedOn;

// Flatten the nested question structure from TalentLMS
const flatQuestions = [];

function extractQuestions(questions) {
  if (!Array.isArray(questions)) return;
  for (const q of questions) {
    let answerText = '';
    if (q.user_answers) {
      if (Array.isArray(q.user_answers) && q.user_answers.length > 0) {
        answerText = q.user_answers[0];
      } else if (typeof q.user_answers === 'object') {
        const values = Object.values(q.user_answers);
        if (values.length > 0) answerText = values[0];
      }
    }

    if (q.text && answerText) {
      flatQuestions.push({ text: q.text, answer: answerText });
    }

    if (q.child_questions && q.child_questions.length > 0) {
      extractQuestions(q.child_questions);
    }
  }
}

if (surveyAnswers && surveyAnswers.questions) {
  extractQuestions(surveyAnswers.questions);
}

function findAnswer(keyword) {
  const match = flatQuestions.find(q => 
    q.text.toLowerCase().includes(keyword.toLowerCase())
  );
  return match ? match.answer : '';
}

const duration = surveyAnswers.total_time || '';

// Use known TalentLMS custom field keys
const row = {
  'User Name': `${userDetails.first_name || ''} ${userDetails.last_name || ''}`.trim(),
  'Email': userDetails.email || '',
  'Role/Title': userDetails.custom_field_23 || '',
  'Department': userDetails.custom_field_25 || '',
  'Hire Date': userDetails.custom_field_31 || '',
  'Start Date': userDetails.custom_field_31 || '',
  'Completion Date': completedOn || surveyAnswers.completed_on || '',
  'Duration (minutes)': duration,
  'Quality_Rating': findAnswer('rate the quality'),
  'Satisfaction_Rating': findAnswer('how satisfied'),
  'Mission_Understanding': findAnswer('mission'),
  'Cross_Team_Connection': findAnswer('connects to other teams'),
  'Readiness_to_Contribute': findAnswer('knowledge I need'),
  'Most_Helpful': findAnswer('most helpful'),
  'Unclear_Topics': findAnswer('still unclear'),
  'Improvement_Suggestions': findAnswer('improve')
};

return { json: row };

// No new users to add
const input = $input.all()[0].json;
return [{ json: { 
  message: 'No new completed users to add to sheet', 
  skipped: true,
  debug: input._debug || 'No debug info'
} }];

// Get emails already in sheet BEFORE this run
const existingEntries = $('Read Existing Entries').all();
const existingEmails = new Set();
for (const entry of existingEntries) {
  const email = (entry.json['Email'] || '').toLowerCase().trim();
  if (email) existingEmails.add(email);
}

// Filter to only truly new entries
const allRows = $input.all();
const newRows = allRows.filter(item => {
  const email = (item.json['Email'] || '').toLowerCase().trim();
  return email && !existingEmails.has(email);
});

if (newRows.length === 0) {
  return [{ json: { text: '', hasNew: false } }];
}

const pstDate = new Date().toLocaleDateString('en-US', {
  timeZone: 'America/Los_Angeles',
  month: 'short', day: 'numeric', year: 'numeric'
});

let message = `\ud83d\udccb Orientation Survey Sync - ${pstDate}\n\n`;
message += `*${newRows.length} new response(s) synced to sheet*\n\n`;

for (const item of newRows) {
  const r = item.json;
  message += `\u2705 *${r['User Name']}*\n`;
  message += `   ${r['Role/Title'] || 'N/A'} | ${r['Department'] || 'N/A'}\n`;
  message += `   Completed: ${r['Completion Date'] || 'N/A'}\n`;
  message += `   Satisfaction: ${r['Satisfaction_Rating'] || 'N/A'} | Quality: ${r['Quality_Rating'] || 'N/A'}\n\n`;
}

message += `Full data \u2192 https://docs.google.com/spreadsheets/d/1SgvK3lM0Yyn6hmaQUqiEfo7ea5UCfyodTShfMb3DGVE`;

return [{ json: { text: message, hasNew: true } }];

